e-field: flag  # 全局逻辑删除的实体字段名(since 3.3.0,配置后可以忽略不配置步骤2)\n      logic-delete-value: 1 # 逻辑已删除值(默认为 1)\n      logic-not-delete-value: 0 # 逻辑未删除值(默认为 0)\n    banner: false\n  \n  #原生配置\n  configuration:\n    map-underscore-to-camel-case: true\n    cache-enabled: false\n    call-setters-on-nulls: true\n    jdbc-type-for-null: \'null\'\n\n\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \"*\"\n\nfeign:\n  sentinel:\n    enabled: true\n\njwt:\n  private: \n  public: \n  \n\nresource:\n  base-uri: https://poo0054.top/renren-fast/sys/authorized\n  vue-uri: https://poo0054.top/web/#/login?token=\n  client_id: themall\n  client_secret: 949839cd-b904-4213-8424-3b809a3af1f3-themall-poo0054-top','533a126234c52f9a0db6c90625eafa90','2023-11-20 02:23:29','2023-12-28 10:26:58','nacos','10.244.0.0','','c6efdd0f-1682-4586-9812-75b5b4e381bd','','','','yaml',''),(260,'themall-gatway-prod.yaml','prod','spring:\n  zipkin:\n    base-url: http://zipkin:9411\n  cloud:\n    sentinel:\n      transport:\n        port: 8719\n        dashboard: sentinel-dashboard:8080\n\n\n\n\n\n','030304846099d3e4e98aa81ce50d0914','2023-11-20 02:23:29','2023-11-28 06:38:47','nacos','10.244.0.0','','c6efdd0f-1682-4586-9812-75b5b4e381bd','','','','yaml',''),(261,'renren-fast-prod.yaml','prod','\n\nspring:\n  zipkin:\n    base-url: http://zipkin:9411\n\n  datasource:\n    type: com.alibaba.druid.pool.DruidDataSource\n    druid:\n      db-type: mysql\n      driver-class-name: com.mysql.cj.jdbc.Driver\n      url: jdbc:mysql://192.168.98.51:3306/themall_admin?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false\n      username: root\n      password: \"005400\"\n      initial-size: 10\n      max-active: 100\n      min-idle: 10\n      max-wait: 60000\n      pool-prepared-statements: true\n      max-pool-prepared-statement-per-connection-size: 20\n      time-between-eviction-runs-millis: 60000\n      min-evictable-idle-time-millis: 300000\n      #Oracle需要打开注释\n      #