are-threads: 30\n  connection-timeout: 5000ms\n  servlet:\n    session:\n      #session超时时间\n      timeout: 30m\n\nspring:\n  zipkin:\n    locator:\n      discovery:\n        #关闭服务发现，否则springcloud会把zipkin的url当成服务名称\n        enabled: false\n    sender:\n      #设置http发送数据\n      type: web\n  sleuth:\n    sampler:\n      #      设置抽取采集率为100%，默认为10%\n      probability: 1\n\n  session:\n    store-type: redis\n    #配置redis缓存管理器\n  cache:\n    type: redis\n    # 配置了名字，就只能使用自己的名字\n    redis:\n      # 存活时间\n      time-to-live: 3600000\n      #前缀\n      #      key-prefix: AUTO-CACHE_\n      #是否使用前缀 不使用前缀但开启前缀 会把分区名放前面  分区::名字\n      use-key-prefix: true\n      #是否缓存空值，解决缓存穿透\n      cache-null-values: true\n  security:\n    oauth2:\n      resourceserver:\n        jwt:\n          issuer-uri: http://127.0.0.1:9000\n\n  # jackson时间格式化\n  jackson:\n    time-zone: GMT+8\n#    date-format: yyyy-MM-dd HH:mm:ss\n  servlet:\n    multipart:\n      max-file-size: 100MB\n      max-request-size: 100MB\n      enabled: true\n  redis:\n    timeout: 6000ms  # 连接超时时长（毫秒）\n\n  mvc:\n    throw-exception-if-no-handler-found: true\n #   date-format: yyyy-MM-dd HH:mm:ss\n\nmybatis-plus:\n  mapper-locations: classpath*:/mapper/**/*.xml\n  global-config:\n    #数据库相关配置\n    db-config:\n      #主键类型  AUTO:\"数据库ID自增\", INPUT:\"用户输入ID\", ID_WORKER:\"全局唯一ID (数字类型唯一ID)\", UUID:\"全局唯一ID UUID\";\n      id-type: ASSIGN_ID\n      logic-delete-field: flag  # 全局逻辑删除的实体字段名(since 3.3.0,配置后可以忽略不配置步骤2)\n      logic-delete-value: 1 # 逻辑已删除值(默认为 1)\n      logic-not-delete-value: 0 # 逻辑未删除值(默认为 0)\n    banner: false\n\n  #原生配置\n  configuration:\n    map-underscore-to-camel-case: true\n    cache-enabled: false\n    call-setters-on-nulls: true\n    jdbc-type-for-null: \'null\'\n\n\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \"*\"\n\nfeign:\n  sentinel:\n    enabled: true\n\njwt:\n  private: \n  public: \n  \n\nresource:\n  base-uri: http://127.0.0.1:8085/renren-fast/sys/authorized\n  vue-uri: http://127.0.0.1:8001/#/login?token=\n  client_id: themall\n  client_secret: 949839cd-b904-4213-8424-3b809a3af1f3-themall-poo0054-top','5742e29aec398c93b3eccc5bc5cabe2b','2010-05-05 00:00:00','2024-01-05 15:36:55','nacos','10.244.0.0','U','c6efdd0f-1682-4586-9812-75b5b4e381bd');
