--
-- Table structure for table `sys_menu`
--

DROP TABLE IF EXISTS `sys_menu`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `sys_menu` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `parent_id` bigint DEFAULT NULL COMMENT '父菜单ID，一级菜单为0',
  `path` varchar(200) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '菜单URL',
  `name` varchar(16) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `component` varchar(16) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '视图',
  `title` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '菜单名称',
  `active` varchar(32) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '菜单高亮',
  `type` varchar(16) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '类型  menu iframe link button',
  `icon` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '菜单图标',
  `tag` varchar(16) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '标签',
  `fullpage` tinyint DEFAULT NULL COMMENT '整页路由',
  `hidden` tinyint DEFAULT NULL COMMENT '隐藏菜单',
  `hiddenBreadcrumb` int DEFAULT NULL COMMENT '隐藏面包屑',
  `color` varchar(16) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '颜色',
  `perms` varchar(500) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '授权(多个用逗号分隔，如：user:list,user:create)',
  `order_num` int DEFAULT '0' COMMENT '排序',
  `flag` int DEFAULT '0' COMMENT '逻辑删除状态 已删除值(默认为 1) 未删除值(默认为 0)',
  `create_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '创建者ID',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '修改人',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1742447816393007107 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='菜单管理';
/*!40101 SET character_set_client = @saved_cs_client */;

